import React, {Component} from "react";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";


import { FaPlus} from "react-icons/fa";
import './tabata.css';
import {NavLink} from "react-router-dom";
import Exercise from "./components/exercise";

class Tabata extends Component {
    render() {
        return (
            <div className="col-3 pt-3">
             <button class="btn" id="tabataBtn">Tabata</button>
             <Exercise/>

            <div class="customizations">
                  <div class="btns">
                    <p>session length</p>
                    <button class="mybtn btnL" id="slM">-</button>
                    <h4 id="sessL">0:00</h4>
                    <button class="mybtn btnR" id="slP">+</button>
                  </div>
                  <div class="btns">
                    <p>break length</p>
                    <button class="mybtn btnL" id="blM">-</button>
                    <h4 id="breaL">0:00</h4>
                    <button class="mybtn btnR" id="blP">+</button>
                  </div>
                  <div class="btns">
                    <p>sessions</p>
                    <button class="mybtn btnL" id="sM">-</button>
                    <h4 id="sessN">0</h4>
                    <button class="mybtn btnR" id="sP">+</button>
                  </div>
                  <button class="btn" id="rstbtn">reset</button>
                </div>

            </div>
        );
    }
}
export default Tabata;
